import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';


import  './components/assets/vendor/jquery/jquery.min.js'
import  './components/assets/vendor/bootstrap/js/bootstrap.bundle.min.js'
import  './components/assets/vendor/jquery.easing/jquery.easing.min.js'
import  './components/assets/vendor/php-email-form/validate.js'
import  './components/assets/vendor/owl.carousel/owl.carousel.min.js'
import  './components/assets/vendor/waypoints/jquery.waypoints.min.js'
import  './components/assets/vendor/counterup/counterup.min.js'
import  './components/assets/vendor/isotope-layout/isotope.pkgd.min.js'
import  './components/assets/vendor/venobox/venobox.min.js'
import  './components/assets/vendor/aos/aos.js'

import  './components/assets/js/main.js'


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
